import React from 'react'

const UserIDS = ({userIDS}) => {
    return (
        <div>
            <center><h1>All User IDs</h1></center>
            {UserIDS.map((ID) => (
              <h5>{ID.userID}</h5>
          ))}
        </div>
    )
};

export default Contacts
